import React from 'react';
import { useNavigate } from 'react-router-dom';
import './HomePage.css'; // Link your CSS

function HomePage() {
  const navigate = useNavigate();

  return (
    <div className="home-container">
      <div className="home-box">
        <h1>Welcome to the Cybersecurity Ransomware Quiz</h1>
        <p>
          Learn how ransomware affects the healthcare industry and test your knowledge
          to improve your cybersecurity awareness.
        </p>
        <div className="home-buttons">
          <button onClick={() => navigate('/quiz')}>Start Quiz</button>
          <button onClick={() => navigate('/info')}>Learn More</button>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
